import React, { Component } from 'react';


class AristSelector extends Component {

    render() {
        return (
            <div>
                <p>L'artiste est ...</p>
                <ul>
                    {this.props.relatedArtists.slice(0, 3).map((artist, key) =>
                        <li key={key}>
                            <img
                                src={artist.imageUrl}
                                alt={artist.name}
                                className="artist-avatar" />
                        </li>
                    )}
                </ul>
            </div>
        )
    }
}

export default AristSelector;
